import numpy as np


class Solution:
    def countSquares(self, matrix):

        numbers = 0
        for i in range(len(matrix)):
            index = 0
            for j in range(len(matrix[i])):

                if matrix[i][j] == 1:

                    numbers = numbers + 1
                    add_ = 1
                    while True:
                        if i + add_ <= len(matrix) - 1 and j + add_ <= len(matrix[i]) - 1:
                            matrix_a = np.array(np.array(matrix)[i:i + add_ + 1, j:j + add_ + 1])
                            a = np.sum(np.reshape(matrix_a, (matrix_a.size,)))
                            b = (add_ + 1) ** 2
                            if a == b:
                                add_ += 1
                                index += 1
                                numbers = numbers + 1
                            else:
                                add_ = 1
                                index = 0
                                break
                        else:
                            add_ = 1
                            index = 0
                            break

        return numbers
